import React from 'react';
import '../styles/App.css';

export default function Home() {
  return (
    <div className="App">
      <div className= "Body">
        <h1>Welcome to my DevLog!</h1>
	<p>Here, I will share the inner working and thought processes of my active projects. Hopefully this will serve as reference material for myself, as well as others </p>
	<p>Stay tuned for updates!</p>
      </div>
     </div>
  );
}
